import React from 'react'
import Todo from './Todo'

const todos = [
  {"descrition": "Einkaufen", "done": true},
  {"descrition": "Sport", "done": false},
  {"descrition": "Lernen", "done": false},
  {"descrition": "Entspannen", "done": true}
];

const TodoList = () => {
  return (
    <>
      <div>Todo List</div>
      {todos.map((item) => {
        return <Todo description={item.descrition} done={item.done}></Todo>;
      })}
    </>
  )
}

export default TodoList
